import React, { Component } from 'react'

import './Home.css'
import * as FiIcons from 'react-icons/fi';
import UsefulVideos from "./YoutubeVideos/UsefulVideos";
import CardUiMain from "../../Components/Card/CardUiMain";
export default class Home extends Component {
    render() {
        return (
            <>

            <div className="usful-numbers-container text-center">
         <h1 ><FiIcons.FiPhoneCall/>  HOT LINE NUMBERS</h1>
         <div className="useful-number d-flex justify-content-center">
          
         </div>

            </div>
                <div>

                    <CardUiMain/>
                </div>
            <div>
                <UsefulVideos/>
            </div>


            </>
        )
    }
}
